		return (
			<div className="App">
				Learn React
			</div>
		);
	}

	fetchPlant = name => {
		fetch(`http://trefle.io/api/plants`, {
			method: 'GET',
			headers: {
				'X-Frame-Options': 'SAMEORIGIN',
				'Content-Type': 'application/json',
				'Authorization': 'Bearer OVUxRkpUM2dkeXpRaFZjd2JqVFlGZz09'
			}
		})
		.then(res => console.log(res))
		.then(json => console.log(json))
	}
}

